INSERT INTO `faculty` VALUES (2,'Faculty of Education and Social Sciences','&lt;div class=&quot;mt-2 text-justify&quot;&gt;\r\n&lt;p class=&quot;font-thin italic info&quot;&gt;Why studying teacher education?&lt;/p&gt;\r\n&lt;p class=&quot;mt-4 text-justify&quot;&gt;Education is a broad discipline that includes learning how to teach others and understanding how people learn during different stages of their lives. The focus of what you study will depend on your interests: Is early childhood education a passion, or would you like to teach older learners? Are you interested in lifelong learning, education policy or curriculum design? Whatever your choice, you have a chance to impact the lives of others.&lt;/p&gt;\r\n&lt;p class=&quot;mt-4 text-justify&quot;&gt;We offer high-quality teaching and thoughtfully developed undergraduate and postgraduate programmes. Further to this, we offer teacher development in diverse subject areas for pre- and in-service teachers. Our research interests are varied, ranging from Business Studies, Literacy and Multilingual Education to Early Childhood Development. Furthermore, the Faculty is committed to promoting our understanding of all aspects of society to improve democracy and the quality of life for a more inclusive society. In addition to its focus on research and teaching, FESS is deeply committed to playing a pivotal role in shaping public discourse and contributing to impactful public policies.&lt;/p&gt;\r\n&lt;/div&gt;',1,'2025-09-02 11:32:07',72,'2025-09-24 13:32:38');
/*!40000 ALTER TABLE `faculty` ENABLE KEYS */;
UNLOCK TABLES;

