INSERT INTO `program` VALUES (1,'Bachelor of Arts in Geography, Environment and Natural Resources Management','BAGENARM',1,NULL,NULL,'3','he','je',1,120,2,2,'2023','2025-09-02 21:59:13',0,'2025-09-22 14:40:32',NULL),(2,'Diploma in Early Childhood Development with Special Needs Education','DECSNE',1,'&lt;p class=&quot;pt-2 text-base&quot;&gt;All foreigners rates are in United State Dollar ($) while Tanzanian\r\n                            are in Tanzania Shillings (Tsh)&lt;/p&gt;\r\n\r\n                        &lt;div class=&quot;w-full mt-6&quot;&gt;\r\n                            &lt;!-- Table Header --&gt;\r\n                            &lt;div class=&quot;bg-slate-800 grid grid-cols-1 sm:grid-cols-3 text-white text-center text-sm sm:text-base rounded-t-xl&quot;&gt;\r\n                                &lt;div class=&quot;border border-slate-600 py-3 px-4 sm:rounded-tl-xl&quot;&gt;Description&lt;/div&gt;\r\n                                &lt;div class=&quot;border border-slate-600 py-3 px-4&quot;&gt;1st Year&lt;/div&gt;\r\n                                &lt;div class=&quot;border border-slate-600 py-3 px-4 sm:rounded-tr-xl&quot;&gt;2nd Year&lt;/div&gt;\r\n                            &lt;/div&gt;\r\n\r\n                            &lt;!-- Currency Row --&gt;\r\n                            &lt;div class=&quot;bg-slate-800 grid grid-cols-1 sm:grid-cols-3 text-white text-center text-sm sm:text-base&quot;&gt;\r\n                                &lt;div class=&quot;border border-slate-600 py-3 px-4&quot;&gt;Currency&lt;/div&gt;\r\n                                &lt;div class=&quot;grid grid-cols-2&quot;&gt;\r\n                                    &lt;div class=&quot;border border-slate-600 py-3 px-4&quot;&gt;TZS&lt;/div&gt;\r\n                                    &lt;div class=&quot;border border-slate-600 py-3 px-4&quot;&gt;USD&lt;/div&gt;\r\n                                &lt;/div&gt;\r\n                                &lt;div class=&quot;grid grid-cols-2&quot;&gt;\r\n                                    &lt;div class=&quot;border border-slate-600 py-3 px-4&quot;&gt;TZS&lt;/div&gt;\r\n                                    &lt;div class=&quot;border border-slate-600 py-3 px-4&quot;&gt;USD&lt;/div&gt;\r\n                                &lt;/div&gt;\r\n                            &lt;/div&gt;\r\n\r\n                            &lt;!-- Tuition Fee --&gt;\r\n                            &lt;div class=&quot;grid grid-cols-1 sm:grid-cols-3 text-center text-sm sm:text-base&quot;&gt;\r\n                                &lt;div class=&quot;bg-slate-800 text-white border border-slate-600 py-3 px-4&quot;&gt;Tuition Fee&lt;/div&gt;\r\n                                &lt;div class=&quot;grid grid-cols-2 bg-slate-300&quot;&gt;\r\n                                    &lt;div class=&quot;text-slate-700 border border-slate-400 py-3 px-4&quot;&gt;950,000&lt;/div&gt;\r\n                                    &lt;div class=&quot;text-slate-700 border border-slate-400 py-3 px-4&quot;&gt;-&lt;/div&gt;\r\n                                &lt;/div&gt;\r\n                                &lt;div class=&quot;grid grid-cols-2 bg-slate-300&quot;&gt;\r\n                                    &lt;div class=&quot;text-slate-700 border border-slate-400 py-3 px-4&quot;&gt;950,000&lt;/div&gt;\r\n                                    &lt;div class=&quot;text-slate-700 border border-slate-400 py-3 px-4&quot;&gt;-&lt;/div&gt;\r\n                                &lt;/div&gt;\r\n                            &lt;/div&gt;\r\n\r\n                            &lt;!-- Admin Fee --&gt;\r\n                            &lt;div class=&quot;grid grid-cols-1 sm:grid-cols-3 text-center text-sm sm:text-base rounded-b-xl&quot;&gt;\r\n                                &lt;div class=&quot;bg-slate-800 text-white border border-slate-600 py-3 px-4 sm:rounded-bl-xl&quot;&gt;\r\n                                    Administration Fee\r\n                                &lt;/div&gt;\r\n                                &lt;div class=&quot;grid grid-cols-2 bg-slate-300&quot;&gt;\r\n                                    &lt;div class=&quot;text-slate-700 border border-slate-400 py-3 px-4&quot;&gt;336,000&lt;/div&gt;\r\n                                    &lt;div class=&quot;text-slate-700 border border-slate-400 py-3 px-4&quot;&gt;-&lt;/div&gt;\r\n                                &lt;/div&gt;\r\n                                &lt;div class=&quot;grid grid-cols-2 bg-slate-300&quot;&gt;\r\n                                    &lt;div class=&quot;text-slate-700 border border-slate-400 py-3 px-4&quot;&gt;326,000&lt;/div&gt;\r\n                                    &lt;div class=&quot;text-slate-700 border border-slate-400 py-3 px-4 sm:rounded-br-xl&quot;&gt;-\r\n                                    &lt;/div&gt;\r\n                                &lt;/div&gt;\r\n                            &lt;/div&gt;\r\n\r\n                            &lt;!-- Note --&gt;\r\n                            &lt;p class=&quot;mt-6 p-4 bg-red-100 rounded-lg text-justify&quot;&gt;\r\n                                Meals and Accommodation allowances are arranged personally between the student and\r\n                                his/her sponsor as per companies/government scales.\r\n                            &lt;/p&gt;\r\n                        &lt;/div&gt;','&lt;p class=&quot;mt-2 text-base&quot;&gt;Admission into the Diploma in Early Childhood Development with Special\r\n                            Needs Education requires one of the following qualifications:&lt;/p&gt;\r\n\r\n                        &lt;div class=&quot;mt-2 font-semibold&quot;&gt;Advanced Certificate of Secondary Education Examination\r\n                            (ACSEE):\r\n                        &lt;/div&gt;\r\n                        &lt;ol class=&quot;list-[lower-alpha] list-inside ml-4 mb-2&quot;&gt;\r\n                            &lt;li&gt;An applicant must have passed with Division I, II, or III with two Principal Passes.\r\n                            &lt;/li&gt;\r\n                        &lt;/ol&gt;\r\n\r\n                        &lt;div class=&quot;font-semibold&quot;&gt;Certificate in Education:&lt;/div&gt;\r\n                        &lt;ol class=&quot;list-[lower-alpha] list-inside ml-4&quot;&gt;\r\n                            &lt;li&gt;Certificate of Primary School Teacher Education, &lt;span\r\n                                    class=&quot;text-green-600 font-semibold&quot;&gt;OR&lt;/span&gt;&lt;/li&gt;\r\n                            &lt;li&gt;Certificate in Early Childhood Education from a recognized institution.&lt;/li&gt;\r\n                        &lt;/ol&gt;','3','The Diploma in Early Childhood Development with Special Needs Education is a two-year programme designed to provide students with foundational knowledge and practical skills necessary for working with young children, particularly those with special educational needs. The programme focuses on equipping students with competencies in early childhood development, inclusive education, child psychology, and specialized teaching methods. Emphasis is placed on effective communication, individualized instruction, and holistic care to support the learning and development of children with diverse needs. Graduates of this diploma will be able to contribute meaningfully to inclusive early childhood education settings and support the developmental and educational needs of children with disabilities or learning difficulties.','&lt;div class=&quot; mx-auto&quot;&gt;\r\n\r\n                        &lt;!-- Title --&gt;\r\n                        &lt;h1 class=&quot;text-2xl sm:text-3xl mt-4 font-bold&quot;&gt;\r\n                            Diploma in Early Childhood Development with Special Needs Education\r\n                        &lt;/h1&gt;\r\n\r\n                        &lt;!-- Divider --&gt;\r\n                        &lt;div class=&quot;mt-3 mb-4&quot;&gt;\r\n                            &lt;span class=&quot;inline-block w-32 h-1 bg-blue-500 rounded-full&quot;&gt;&lt;/span&gt;\r\n                            &lt;span class=&quot;inline-block w-3 h-1 mx-1 bg-blue-500 rounded-full&quot;&gt;&lt;/span&gt;\r\n                            &lt;span class=&quot;inline-block w-1 h-1 bg-blue-500 rounded-full&quot;&gt;&lt;/span&gt;\r\n                        &lt;/div&gt;\r\n\r\n                        &lt;!-- Description --&gt;\r\n                        &lt;p class=&quot;py-2 text-base sm:text-lg text-justify leading-relaxed&quot;&gt;\r\n                            The Diploma in Early Childhood Development with Special Needs Education is a two-year\r\n                            programme designed to provide students with foundational knowledge and practical skills\r\n                            necessary for working with young children, particularly those with special educational\r\n                            needs. The programme focuses on equipping students with competencies in early childhood\r\n                            development, inclusive education, child psychology, and specialized teaching methods.\r\n                            Emphasis is placed on effective communication, individualized instruction, and holistic care\r\n                            to support the learning and development of children with diverse needs. Graduates of this\r\n                            diploma will be able to contribute meaningfully to inclusive early childhood education\r\n                            settings and support the developmental and educational needs of children with disabilities\r\n                            or learning difficulties.\r\n                        &lt;/p&gt;\r\n\r\n                        &lt;!-- Entry Requirements --&gt;\r\n                        &lt;h2 data-aos=&quot;fade-up&quot; data-aos-duration=&quot;1000&quot; class=&quot;text-xl sm:text-2xl mt-6 font-bold&quot;&gt;\r\n                            Minimum Entry Requirement&lt;/h2&gt;\r\n                        &lt;p class=&quot;mt-2 text-base&quot;&gt;Admission into the Diploma in Early Childhood Development with Special\r\n                            Needs Education requires one of the following qualifications:&lt;/p&gt;\r\n\r\n                        &lt;div class=&quot;mt-2 font-semibold&quot;&gt;Advanced Certificate of Secondary Education Examination\r\n                            (ACSEE):\r\n                        &lt;/div&gt;\r\n                        &lt;ol class=&quot;list-[lower-alpha] list-inside ml-4 mb-2&quot;&gt;\r\n                            &lt;li&gt;An applicant must have passed with Division I, II, or III with two Principal Passes.\r\n                            &lt;/li&gt;\r\n                        &lt;/ol&gt;\r\n\r\n                        &lt;div class=&quot;font-semibold&quot;&gt;Certificate in Education:&lt;/div&gt;\r\n                        &lt;ol class=&quot;list-[lower-alpha] list-inside ml-4&quot;&gt;\r\n                            &lt;li&gt;Certificate of Primary School Teacher Education, &lt;span\r\n                                    class=&quot;text-green-600 font-semibold&quot;&gt;OR&lt;/span&gt;&lt;/li&gt;\r\n                            &lt;li&gt;Certificate in Early Childhood Education from a recognized institution.&lt;/li&gt;\r\n                        &lt;/ol&gt;\r\n\r\n                        &lt;!-- Apply Button --&gt;\r\n                        &lt;div class=&quot;mt-4&quot;&gt;\r\n                            &lt;app-apply-btn-old&gt;&lt;/app-apply-btn-old&gt;\r\n                        &lt;/div&gt;\r\n\r\n                        &lt;!-- Fees Structure --&gt;\r\n                        &lt;h2 data-aos=&quot;fade-up&quot; data-aos-duration=&quot;1000&quot; class=&quot;text-xl sm:text-2xl mt-10 font-bold&quot;&gt;Fees\r\n                            Structure&lt;/h2&gt;\r\n                        &lt;p class=&quot;pt-2 text-base&quot;&gt;All foreigners rates are in United State Dollar ($) while Tanzanian\r\n                            are in Tanzania Shillings (Tsh)&lt;/p&gt;\r\n\r\n                        &lt;div class=&quot;w-full mt-6&quot;&gt;\r\n                            &lt;!-- Table Header --&gt;\r\n                            &lt;div class=&quot;bg-slate-800 grid grid-cols-1 sm:grid-cols-3 text-white text-center text-sm sm:text-base rounded-t-xl&quot;&gt;\r\n                                &lt;div class=&quot;border border-slate-600 py-3 px-4 sm:rounded-tl-xl&quot;&gt;Description&lt;/div&gt;\r\n                                &lt;div class=&quot;border border-slate-600 py-3 px-4&quot;&gt;1st Year&lt;/div&gt;\r\n                                &lt;div class=&quot;border border-slate-600 py-3 px-4 sm:rounded-tr-xl&quot;&gt;2nd Year&lt;/div&gt;\r\n                            &lt;/div&gt;\r\n\r\n                            &lt;!-- Currency Row --&gt;\r\n                            &lt;div class=&quot;bg-slate-800 grid grid-cols-1 sm:grid-cols-3 text-white text-center text-sm sm:text-base&quot;&gt;\r\n                                &lt;div class=&quot;border border-slate-600 py-3 px-4&quot;&gt;Currency&lt;/div&gt;\r\n                                &lt;div class=&quot;grid grid-cols-2&quot;&gt;\r\n                                    &lt;div class=&quot;border border-slate-600 py-3 px-4&quot;&gt;TZS&lt;/div&gt;\r\n                                    &lt;div class=&quot;border border-slate-600 py-3 px-4&quot;&gt;USD&lt;/div&gt;\r\n                                &lt;/div&gt;\r\n                                &lt;div class=&quot;grid grid-cols-2&quot;&gt;\r\n                                    &lt;div class=&quot;border border-slate-600 py-3 px-4&quot;&gt;TZS&lt;/div&gt;\r\n                                    &lt;div class=&quot;border border-slate-600 py-3 px-4&quot;&gt;USD&lt;/div&gt;\r\n                                &lt;/div&gt;\r\n                            &lt;/div&gt;\r\n\r\n                            &lt;!-- Tuition Fee --&gt;\r\n                            &lt;div class=&quot;grid grid