uot;&gt;\r\n                                &lt;p class=&quot;text-slate-600 text-center border border-slate-400  px-3 py-3 bg-slate-300&quot;&gt;\r\n                                    336,000&lt;/p&gt;\r\n                                &lt;p class=&quot;text-slate-600 text-center border border-slate-400  px-4 py-3 bg-slate-300&quot;&gt;\r\n                                    -&lt;/p&gt;\r\n                            &lt;/div&gt;\r\n                            &lt;div class=&quot;grid grid-cols-2 &quot;&gt;\r\n                                &lt;p class=&quot;text-slate-600 text-center border border-slate-400  px-3 py-3 bg-slate-300&quot;&gt;\r\n                                    326,000&lt;/p&gt;\r\n                                &lt;p class=&quot;text-slate-600 text-center border border-slate-400  px-4 py-3 bg-slate-300&quot;&gt;\r\n                                    -&lt;/p&gt;\r\n                            &lt;/div&gt;\r\n                            &lt;div class=&quot; grid  grid-cols-2&quot;&gt;\r\n                                &lt;p class=&quot;text-slate-600 text-center border border-slate-400  px-3 py-3 bg-slate-300&quot;&gt;\r\n                                    266,000 &lt;/p&gt;\r\n                                &lt;p class=&quot;text-slate-600 text-center border border-slate-400  px-4 py-3 rounded-br-xl bg-slate-300&quot;&gt;\r\n                                    -&lt;/p&gt;\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n\r\n                        &lt;p class=&quot;mt-10 p-4 bg-red-100 rounded-lg&quot;&gt; Meals and Accommodation allowances are arranged\r\n                            personally between the student and his/her sponsor as per companies/government scales&lt;/p&gt;','&lt;p class=&quot;text-md mt-4 font-bold&quot;&gt;A. Direct entry applicants&lt;/p&gt;\r\n                        &lt;p class=&quot;pt-2 pb-1 text-lg text-justify mb-4 ml-4&quot;&gt;\r\n                            i. At least three O&#039;level credit passes in approved subjects.\r\n                        &lt;/p&gt;\r\n                        &lt;p class=&quot; text-lg text-justify mb-4 ml-4&quot;&gt;\r\n                            ii. Two principal passes in Advanced Certificate of Secondary Education in the following\r\n                            subjects: History, Geography, Kiswahili, English Language, Literature in English, French,\r\n                            Arabic, Fine Art, with 4.0 points. where A = 5, B = 4, C = 3,D = 2,E = 1,S = 0.5\r\n                        &lt;/p&gt;\r\n                        &lt;p class=&quot;text-md mt-4 font-bold&quot;&gt;B. Applicants seeking admission under the equivalent\r\n                            qualifications&lt;/p&gt;\r\n                        &lt;p class=&quot;pt-2 pb-1 text-lg text-justify mb-4 ml-4&quot;&gt;\r\n                            i. At least three O`level credit passes in relevant subjects.\r\n                        &lt;/p&gt;\r\n                        &lt;p class=&quot; text-lg text-justify mb-4 ml-4&quot;&gt;\r\n                            ii. A recognized Diploma in Education with an average of “B” or a minimum GPA of 3.0.\r\n                        &lt;/p&gt;','3','The Bachelor of Education in Special Needs (BEDSN) programme aims at providing theoretical and practical skills to students. It is designed to equip students with an understanding of the various fields of special needs education, relevant key concepts, as well as educational policies, trends, settings, categories of disabilities and relevant interventions. The student-teachers will acquire specific knowledge and skills on how to diagnose, communicate and teach-cum-handle students with different disabilities and impairments.','&lt;p class=&quot;py-4 text-lg text-justify&quot;&gt;\r\n                            The Bachelor of Education in Special Needs (BEDSN) programme aims at providing theoretical\r\n                            and practical skills to students. It is designed to equip students with an understanding of\r\n                            the various fields of special needs education, relevant key concepts, as well as educational\r\n                            policies, trends, settings, categories of disabilities and relevant interventions. The\r\n                            student-teachers will acquire specific knowledge and skills on how to diagnose, communicate\r\n                            and teach-cum-handle students with different disabilities and impairments.\r\n                        &lt;/p&gt;',1,500,2,27,'2010','2025-09-18 11:42:26',0,'2025-09-22 14:40:32',NULL),(7,'Master of Educational Management in Special and Inclusive Education','MEMSIE',1,'','&lt;p class=&quot;text-lg text-gray-700 mb-4&quot;&gt;\r\n                            An eligible applicant for MEMSIE programme should possess any of the following academic\r\n                            requirements/qualifications:\r\n                        &lt;/p&gt;\r\n\r\n                        &lt;ol class=&quot;list-[lower-roman] list-inside text-lg text-gray-700 space-y-3 pl-4&quot;&gt;\r\n                            &lt;li&gt;\r\n                                Holder of a Postgraduate Diploma in any field of Education with a minimum GPA of 4.0.\r\n                            &lt;/li&gt;\r\n                            &lt;li&gt;\r\n                                Any education related Bachelor degree with a minimum GPA of 2.7. Applicants who hold\r\n                                unclassified degrees should have at least a B grade average in relevant subjects of the\r\n                                intended area of specialization.\r\n                            &lt;/li&gt;\r\n                        &lt;/ol&gt;','3','The Master of Educational Management in Special and Inclusive Education (MEMSIE) is a two-year postgraduate program designed to equip students with advanced managerial, supervisory, and leadership skills tailored to the unique needs of special and inclusive education settings. This program provides a comprehensive understanding of the diverse needs of learners with disabilities, including physical, visual, hearing, intellectual, autistic, and speech/language impairments.\r\n\r\nMEMSIE aims to develop competent and visionary education managers, administrators, and policy-makers capable of leading special and inclusive institutions such as schools, colleges, and educational offices in both the public and private sectors. Through a blend of theoretical knowledge and practical training, the program prepares graduates to effectively manage and support inclusive learning environments that promote equal access and participation for all learners.\r\n\r\nThe program responds to the growing demand for skilled professionals who can contribute to the advancement of special and inclusive education. It is structured to foster critical thinking, inclusive leadership, and evidence-based practices, ensuring that graduates are well-prepared to champion inclusive education at local, national, and international levels.','&lt;h1 class=&quot;text-3xl md:text-4xl font-extrabold text-amucta-blue mb-4 leading-tight&quot;&gt;\r\n                            Master of Educational Management in Special and Inclusive Education (MEMSIE)\r\n                        &lt;/h1&gt;\r\n\r\n                        &lt;p class=&quot;text-lg md:text-xl text-justify text-gray-700 leading-relaxed mb-6&quot;&gt;\r\n                            The Master of Educational Management in Special and Inclusive Education (MEMSIE) is a two-year postgraduate program designed to equip students with advanced managerial, supervisory, and leadership skills tailored to the unique needs of special and inclusive education settings. This program provides a comprehensive understanding of the diverse needs of learners with disabilities, including physical, visual, hearing, intellectual, autistic, and speech/language impairments. &lt;/p&gt;\r\n\r\n                        &lt;p class=&quot;text-lg md:text-xl text-justify text-gray-700 leading-relaxed mb-6&quot;&gt;\r\n                            MEMSIE aims to develop competent and visionary education managers, administrators, and policy-makers capable of leading special and inclusive institutions such as schools, colleges, and educational offices in both the public and private sectors. Through a blend of theoretical knowledge and practical training, the program prepares graduates to effectively manage and support inclusive learning environments that promote equal access and participation for all learners.\r\n                        &lt;/p&gt;\r\n\r\n                        &lt;p class=&quot;text-lg md:text-xl text-justify text-gray-700 leading-relaxed mb-6&quot;&gt;\r\n                            The program responds to the growing demand for skilled professionals who can contribute to the advancement of special and inclusive education. It is structured to foster critical thinking, inclusive leadership, and evidence-based practices, ensuring that graduates are well-prepared to champion inclusive education at local, national, and international levels.\r\n                        &lt;/p&gt;',2,2000,2,26,'2025','2025-09-18 11:45:48',0,'2025-09-22 14:40:32',NULL);
